<!DOCTYPE html>

<html lang="pl">
<head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>Wywołania z dźwiękiem</title>
<script src="https://www.gstatic.com/firebasejs/9.6.1/firebase-app-compat.js"></script>
<script src="https://www.gstatic.com/firebasejs/9.6.1/firebase-database-compat.js"></script>
<style>
    body {
      font-family: sans-serif;
      background: black;
      color: white;
      text-align: center;
      margin: 0;
      padding: 2vh 2vw;
    }

    header {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 4vh;
    }

    #logo {
      height: 70px;
    }

    #clock {
      width: 60px;
      height: 60px;
      border: 4px solid orange;
      border-radius: 50%;
      position: relative;
      margin-right: 10px;
    }

    .hand {
      position: absolute;
      width: 50%;
      height: 2px;
      background: orange;
      top: 50%;
      left: 50%;
      transform-origin: 0% 50%;
      transform: rotate(90deg);
    }

    h1 {
      font-size: 5vw;
      margin-bottom: 2vh;
    }

    .smacznego {
      font-size: 3vw;
      color: orange;
      margin-bottom: 2vh;
      font-style: italic;
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 1vw;
    }

    #soundUnlock {
      position: absolute;
      top: 10px;
      left: 50%;
      transform: translateX(-50%);
      text-align: center;
      z-index: 1000;
    }

    .speaker {
      width: 30px;
      height: 30px;
      cursor: pointer;
      filter: invert(80%) sepia(100%) saturate(500%) hue-rotate(5deg);
    }

    .number {
      display: block;
      font-size: 8vw;
      margin: 2vh auto;
      padding: 5px 15px;
      border-radius: 10px;
      transition: background-color 0.5s;
      width: fit-content;
    }

    .highlight {
      background-color: darkorange;
    }

    #audio-player {
      display: none;
    }

    @media (min-width: 768px) {
      h1 { font-size: 2.5vw; }
      .smacznego { font-size: 1.8vw; }
      .number { font-size: 4vw; }
    }
  </style>
</head>

<div id="clock">
<div class="hand" id="hour"></div>
<div class="hand" id="minute"></div>
<div class="hand" id="second"></div>
</div>

<h1>Zapraszamy po odbiór gotowego zamówienia</h1>
<div class="smacznego">
    Życzymy Smacznego!
    <img class="speaker" id="soundUnlock" src="https://img.icons8.com/ios-filled/50/speaker.png" title="Kliknij, aby włączyć dźwięk"/>
</div>
<div id="calls"></div>
<audio id="audio-player" preload="auto"></audio>
<script>
    const firebaseConfig = {
      apiKey: "AIzaSyBPU4kXi0gq1HuQLYwO8929-1RwBXVwB4k",
      authDomain: "system-wywolania-54250.firebaseapp.com",
      databaseURL: "https://system-wywolania-54250-default-rtdb.europe-west1.firebasedatabase.app",
      projectId: "system-wywolania-54250",
      storageBucket: "system-wywolania-54250.firebaseapp.com",
      messagingSenderId: "700788175836",
      appId: "1:700788175836:web:40f79c8dfba066c3ff9519"
    };
    firebase.initializeApp(firebaseConfig);
    const db = firebase.database();

    let audioEnabled = false;
    const audioPlayer = document.getElementById("audio-player");
    const soundUnlock = document.getElementById("soundUnlock");

    soundUnlock.addEventListener("click", () => {
      audioEnabled = true;
      soundUnlock.style.display = "none";
      // Odtwarzamy pusty dźwięk aby odblokować
      audioPlayer.src = "";
      audioPlayer.play().catch(() => { });
    });

    db.ref("calls").on("value", (snapshot) => {
      const data = snapshot.val();
      const callsDiv = document.getElementById("calls");
      callsDiv.innerHTML = "";
      if (!data) return;
      const entries = Object.values(data).sort((a, b) => b.time - a.time);
      const now = Date.now();

      entries.forEach(entry => {
        const div = document.createElement("div");
        div.classList.add("number");

        if (now - entry.time < 20000) {
          div.classList.add("highlight");

          if (audioEnabled && entry.number >= 1 && entry.number <= 120) {
            audioPlayer.src = entry.number + ".mp3";
            audioPlayer.play().catch(e => console.log("Błąd odtwarzania:", e));
          }
        }

        div.textContent = entry.number;
        callsDiv.appendChild(div);
      });
    });

    function updateClock() {
      const now = new Date();
      const seconds = now.getSeconds();
      const minutes = now.getMinutes();
      const hours = now.getHours();

      const secondDeg = seconds * 6;
      const minuteDeg = minutes * 6 + seconds * 0.1;
      const hourDeg = ((hours % 12) * 30) + (minutes / 2);

      document.getElementById("second").style.transform = "rotate(" + secondDeg + "deg)";
      document.getElementById("minute").style.transform = "rotate(" + minuteDeg + "deg)";
      document.getElementById("hour").style.transform = "rotate(" + hourDeg + "deg)";
    }

    setInterval(updateClock, 1000);
    updateClock();
  </script>
<script>
document.addEventListener('DOMContentLoaded', () => {
  const audio = document.getElementById('audio-player');
  let unlocked = false;

  function unlockAudio() {
    if (!unlocked) {
      audio.src = "";
      audio.play().catch(() => {});
      unlocked = true;
    }
  }

  document.body.addEventListener('click', unlockAudio, { once: true });

  // Kliknięcie nadal działa
  document.querySelectorAll('.number[data-number]').forEach(el => {
    el.addEventListener('click', () => {
      document.querySelectorAll('.number.highlight').forEach(e => e.classList.remove('highlight'));
      el.classList.add('highlight');
      const num = el.getAttribute('data-number');
      if (num) {
        audio.pause();
        audio.removeAttribute('src');
        audio.load();
        audio.src = `mp3/${num}.mp3`;
        audio.load();
        audio.play().catch(e => console.log(e));
        console.log("Odtwarzam numer:", num);
      }
    });
  });

  // Obserwuj DOM i pilnuj tylko jednego .highlight
  const observer = new MutationObserver(() => {
    const highlighted = document.querySelectorAll('.number.highlight');
    if (highlighted.length > 1) {
      highlighted.forEach((el, index) => {
        if (index > 0) el.classList.remove('highlight');
      });
    }
  });

  observer.observe(document.body, {
    childList: true,
    subtree: true,
    attributes: true,
    attributeFilter: ['class']
  });
});
</script></body>
